import React, { Component } from 'react';
import { Tab, Tabs } from '@blueprintjs/core';

import AppBar from '../../components/AppBar/AppBar';
import Sidebar from '../../components/Sidebar/Sidebar';
import MainContainer from '../../components/MainContainer/MainContainer';

import ProjectsManagerCard from './components/ProjectCard/ProjectsManagerCard';
import SLACard from './components/SLACard/SLACard';
import EmployeeCard from './components/EmployeeCard/EmployeeCard';

export default class Projects extends Component {
   render() {
      return (
         <div>
            <AppBar />
            <Sidebar />
            <MainContainer>
               <Tabs
                  id='1'
                  onChange={this.handleTabChange}
                  selectedTabId={activeTabIndes}
                  large
               >
                  <Tab
                     id='1'
                     title='ProjectManagerCard'
                     panel={<ProjectsManagerCard />}
                  />
                  <Tab id='2' title='SLACard' panel={<SLACard />} />
                  <Tab id='3' title='EmployeeCard' panel={<EmployeeCard />} />
               </Tabs>
            </MainContainer>
         </div>
      );
   }
}
